import React, { useEffect } from 'react';
import ScrollReveal from 'scrollreveal';

// Example watch images (replace with your own or use Unsplash links)
const watches = [
  {
    name: "Classic Chronograph",
    img: "https://images.unsplash.com/photo-1516574187841-cb9cc2ca948b?auto=format&fit=crop&w=600&q=80",
    desc: "Timeless elegance with modern precision.",
  },
  {
    name: "Minimalist Silver",
    img: "https://images.unsplash.com/photo-1465101046530-73398c7f28ca?auto=format&fit=crop&w=600&q=80",
    desc: "Sleek, simple, and stunning.",
  },
  {
    name: "Sporty Black",
    img: "https://images.unsplash.com/photo-1506744038136-46273834b3fb?auto=format&fit=crop&w=600&q=80",
    desc: "Bold design for active lifestyles.",
  },
];

function App() {
  useEffect(() => {
    ScrollReveal().reveal('.reveal', {
      distance: '60px',
      duration: 1200,
      easing: 'cubic-bezier(0.5, 0, 0, 1)',
      origin: 'bottom',
      interval: 200,
      reset: false,
      opacity: 0,
      scale: 0.95,
    });
    ScrollReveal().reveal('.fade-in', {
      duration: 1500,
      opacity: 0,
      scale: 0.9,
      reset: false,
      interval: 300,
    });
  }, []);

  return (
    <div style={{
      minHeight: '100vh',
      background: 'linear-gradient(135deg, #232526 0%, #414345 100%)',
      fontFamily: 'Poppins, sans-serif',
      color: '#fff',
      padding: 0,
      margin: 0,
    }}>
      {/* Hero Section */}
      <section style={{
        minHeight: '90vh',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        background: 'linear-gradient(120deg, #232526 60%, #ffb347 100%)',
        position: 'relative',
        overflow: 'hidden',
      }}>
        <h1 className="reveal" style={{
          fontSize: '3rem',
          fontWeight: 800,
          letterSpacing: '2px',
          marginBottom: '1rem',
          textShadow: '0 4px 32px #0008',
        }}>
          Trendy Watches 2025
        </h1>
        <p className="reveal" style={{
          fontSize: '1.3rem',
          maxWidth: 500,
          textAlign: 'center',
          marginBottom: '2rem',
          color: '#fff9',
        }}>
          Discover the latest in luxury and style. Elevate your wrist game with our exclusive collection.
        </p>
        <img
          className="fade-in"
          src="https://images.unsplash.com/photo-1516574187841-cb9cc2ca948b?auto=format&fit=crop&w=600&q=80"
          alt="Hero Watch"
          style={{
            width: 220,
            height: 220,
            borderRadius: '50%',
            objectFit: 'cover',
            boxShadow: '0 8px 40px #0007',
            border: '6px solid #ffb347',
            marginBottom: '2rem',
            animation: 'pulse 2s infinite alternate',
          }}
        />
        <a
          href="#collection"
          className="reveal"
          style={{
            padding: '0.9rem 2.2rem',
            background: 'linear-gradient(90deg, #ffb347 60%, #ffcc33 100%)',
            color: '#232526',
            fontWeight: 700,
            borderRadius: 40,
            fontSize: '1.1rem',
            textDecoration: 'none',
            boxShadow: '0 2px 16px #ffb34755',
            transition: 'background 0.3s',
          }}
        >
          View Collection
        </a>
        {/* Decorative graphics */}
        <div style={{
          position: 'absolute',
          top: 0, left: 0, width: '100%', height: '100%',
          pointerEvents: 'none',
        }}>
          <svg width="100%" height="100%">
            <circle cx="90%" cy="10%" r="60" fill="#ffb34733" />
            <circle cx="10%" cy="80%" r="40" fill="#ffb34722" />
          </svg>
        </div>
      </section>

      {/* Watch Collection */}
      <section id="collection" style={{
        padding: '4rem 0 2rem 0',
        background: 'linear-gradient(120deg, #414345 60%, #232526 100%)',
        minHeight: '80vh',
      }}>
        <h2 className="reveal" style={{
          textAlign: 'center',
          fontSize: '2.3rem',
          fontWeight: 700,
          marginBottom: '2.5rem',
          letterSpacing: '1px',
        }}>
          Our Trending Collection
        </h2>
        <div style={{
          display: 'flex',
          flexWrap: 'wrap',
          justifyContent: 'center',
          gap: '2.5rem',
        }}>
          {watches.map((watch, idx) => (
            <div
              className="fade-in"
              key={watch.name}
              style={{
                background: 'rgba(255,255,255,0.04)',
                borderRadius: 28,
                boxShadow: '0 4px 32px #0005',
                padding: '2rem 1.5rem 1.5rem 1.5rem',
                maxWidth: 320,
                minWidth: 260,
                textAlign: 'center',
                transition: 'transform 0.3s',
                border: '1.5px solid #ffb34733',
                backdropFilter: 'blur(2px)',
              }}
            >
              <img
                src={watch.img}
                alt={watch.name}
                style={{
                  width: '100%',
                  height: 180,
                  objectFit: 'cover',
                  borderRadius: 18,
                  marginBottom: '1.2rem',
                  boxShadow: '0 2px 16px #ffb34744',
                  border: '3px solid #ffb34722',
                  transition: 'transform 0.3s',
                }}
              />
              <h3 style={{
                fontSize: '1.3rem',
                fontWeight: 700,
                margin: '0.5rem 0',
                color: '#ffb347',
                letterSpacing: '1px',
              }}>{watch.name}</h3>
              <p style={{
                color: '#fffbbd',
                fontSize: '1rem',
                marginBottom: 0,
                opacity: 0.85,
              }}>{watch.desc}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Footer */}
      <footer style={{
        textAlign: 'center',
        padding: '2rem 0 1rem 0',
        color: '#fff8',
        fontSize: '1rem',
        letterSpacing: '1px',
      }}>
        <span>
          &copy; {new Date().getFullYear()} Trendy Watches &mdash; Designed by Nilesh Sinha
        </span>
      </footer>

      {/* Keyframes for pulse animation */}
      <style>
        {`
          @import url('https://fonts.googleapis.com/css2?family=Poppins:wght@400;700;800&display=swap');
          @keyframes pulse {
            0% { transform: scale(1);}
            100% { transform: scale(1.06);}
          }
          ::selection {
            background: #ffb34755;
          }
        `}
      </style>
    </div>
  );
}

export default App;
